// ("catac")
// >>> make_palindrome(("cata"))
// ("catac")
std::string make_palindrome(std::string string) {
    int n = string.size();
    int i = 0;
    for (i = n; i >= 0; i--) {
        if (std::equal(string.begin(), string.begin() + i, string.rbegin())) {
            break;
        }
    }
    std::string prefix(string.begin(), string.begin() + i);
    std::string suffix(string.rbegin(), string.rbegin() + n - i);
    return string + std::string(suffix.rbegin(), suffix.rend());

