// - Find the longest postfix of supplied string that is a palindrome.
// - Append to the end of the string reverse of a string prefix that comes before the palindromic suffix.
// >>> make_palindrome((""))
// ("")
// >>> make_palindrome(("cat"))
// ("catac")
// >>> make_palindrome(("cata"))
// ("catac")
std::string make_palindrome(std::string string) {
    int len = string.size();
    int i = len;
    while(i > 0) {
        std::string suffix = string.substr(0, i);
        std::string reverse_suffix(suffix.rbegin(), suffix.rend());
        if(string.substr(0, i) == reverse_suffix) {
            return string + std::string(string.rbegin(), string.rbegin() + len - i);
        }
        i--;
    }
    return string + std::string(string.rbegin(), string.rbegin() + len);

