// "ccc"
std::optional<std::string> longest(std::vector<std::string> strings) {
    if(strings.empty()) {
        return std::nullopt;
    }
    std::string longest = strings[0];
    for(const std::string& str : strings) {
        if(str.size() > longest.size()) {
            longest = str;
        }
    }
    return longest;

