// >>> correct_bracketing(("<"))
// (false)
// >>> correct_bracketing(("<>"))
// (true)
// >>> correct_bracketing(("<<><>>"))
// (true)
// >>> correct_bracketing(("><<>"))
// (false)
bool correct_bracketing(std::string brackets) {
    std::stack<char> stack;
    for (char c : brackets) {
        if (c == '<') {
            stack.push(c);
        } else if (c == '>') {
            if (stack.empty() || stack.top() != '<') {
                return false;
            }
            stack.pop();
        }
    }
    return stack.empty();

