// if this ingeger is a cube of some integer number.
// Note: you may assume the input is always valid.
// Examples:
// >>> iscube((1))
// (true)
// >>> iscube((2))
// (false)
// >>> iscube((-1))
// (true)
// >>> iscube((64))
// (true)
// >>> iscube((0))
// (true)
// >>> iscube((180))
// (false)
bool iscube(long a) {
    long left = 0;
    long right = abs(a);
    while (left <= right) {
        long mid = left + (right - left) / 2;
        long cube = mid * mid * mid;
        if (cube == abs(a)) {
            return true;
        } else if (cube < abs(a)) {
            left = mid + 1;
        } else {
            right = mid - 1;
        }
    }
    return false;

