// Given a positive integer n, return the product of the odd digits.
// Return 0 if all digits are even.
// For example:
// >>> digits((1))
// (1)
// >>> digits((4))
// (0)
// >>> digits((235))
// (15)
long digits(long n) {
    long product = 1;
    bool isOddDigitPresent = false;
    while (n != 0) {
        long digit = n % 10;
        if (digit % 2 != 0) {
            product *= digit;
            isOddDigitPresent = true;
        }
        n /= 10;
    }
    return isOddDigitPresent ? product : 0;

