// Return 0 if all digits are even.
// For example:
// >>> digits((1))
// (1)
// >>> digits((4))
// (0)
// >>> digits((235))
// (15)
long digits(long n) {
    long product = 1;
    bool isOddDigit = false;
    while (n > 0) {
        long digit = n % 10;
        if (digit % 2 != 0) {
            product *= digit;
            isOddDigit = true;
        }
        n /= 10;
    }
    return isOddDigit ? product : 0;

