// ("_Example_2")
// >>> fix_spaces((" Example 3"))
// ("_Example-3")
std::string fix_spaces(std::string text) {
    std::string result;
    int count = 0;
    for (char c : text) {
        if (c == ' ') {
            count++;
            if (count == 1) {
                result += '_';
            } else if (count > 2) {
                result.pop_back();
                result += '-';
            }
        } else {
            result += c;
            count = 0;
        }
    }
